message:
Vídeo de hoje, 08/12/22, no Tik Tok oficial do Bolsonaro @bolsonaromessiasjair 

A música do vídeo é instrumental, sem letra. 

Possíveis interpretações das cenas do dia da posse, mostradas no vídeo: 

- Estou me preparando;
- Sou o presidente!; 
- Rumo à vitória;
- O Ladrão não sobe a rampa. Fiquemos nos quartéis;
- Rolls Royce não está danificado, mané. Vou usá-lo!;
- Final do vídeo o presidente fala “tá quase”.

E aí, o que mais vocês interpretam?
